    const dispatch = useDispatch();

    return (
        <>
        <label>
        <div className="checkLi" key={id}>
            <span>
                <input className="one" type="checkbox" checked={checked} onChange={() =>{dispatch(checkedTickets(id), dispatch(someTicketsName(checked)))}} onClick={() => onClick(id)} />
            </span>
            <span className="text">{label}</span>
            <span className="text_2">ТОЛЬКО</span>
        </div>
        </label>
        </>
    )
}

export default FilterItem;
